import { title } from "process";
import Header from "../../components/header/Header";
import dataRoutine from "../../helpers/data"

function RoutineDays(){

    const selectedTitle = window.localStorage.getItem(title);

    return(
        <>
            <Header></Header>
            {dataRoutine.map((routine, idx) => (
                        <a href="" key={idx}>{routine.title = window.localStorage.getItem(title)}</a>
                    ))}
        </>
    );
}

export default RoutineDays
